  <title>Enlaces para iDempiere</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      background-color: ghostwhite;
      display: flex;
      justify-content: center;
      align-items: center;
      min-height: 100vh;
      margin: 0;
      padding: 16px;
    }

    .container {
      background-color: #ffffff;
      box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
      border-radius: 8px;
      padding: 24px;
      width: 100%;
      max-width: 400px;
    }

    .header {
      text-align: center;
      margin-bottom: 32px;
    }

    .header img {
      width: 200px;
      height: 200px;
    }

    .header h1 {
      font-size: 32px;
      font-weight: bold;
      margin: 16px 0;
    }

    ul {
      list-style: none;
      padding: 0;
      margin: 0;
    }

    li {
      border-bottom: 1px solid #e2e8f0;
      padding-bottom: 8px;
      margin-bottom: 8px;
      transition: background-color 0.3s;
    }

    li:hover {
      background-color: #f1f5f9;
    }

    a {
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 10px;
      text-decoration: none;
      color: #3b82f6;
      transition: color 0.3s;
    }

    a:hover {
      color: #1d4ed8;
    }

    a img {
      width: 68px;
      height: 68px;
      margin-right: 16px;
    }

    a span {
      font-size: 18px;
      font-weight: 500;
    }

    .header .logo_image {
      display: inline-block;
      width: 270px;
      height: 40px;
    }
  </style>
</head>
